import React from 'react'
import '../App.css';
import { Link } from 'react-router-dom';
import {ReactComponent as Logo} from './logo.svg';


const Header = () => {
    return(
        <nav>
            <div classname='div-header'>

                        <Link to="/" class="a">
                            <Logo className='div-svg'/> 
                        </Link>
            </div>
        </nav>
    )
}

export default Header;
